CREATE DEFINER=`root`@`localhost` PROCEDURE `THEM_SACH`(IN `user_id_param` INT, IN `product_id_param` INT, IN `quantity_new` INT)
BEGIN
    DECLARE orderId INT;
    DECLARE orderId_2 INT;
    DECLARE product_price INT;
    DECLARE email_param VARCHAR(100);
    
    -- Lấy ra order_id kiểm tra có tồn tại chưa
    SELECT id INTO orderId
    FROM orders
    WHERE orders.user_id = user_id_param AND status = 'Carts';
    
    -- Lấy ra thông tin người dùng
    SELECT email INTO email_param
    FROM users
    WHERE id = user_id_param;
    
    -- Lấy ra thông tin sản phẩm
    SELECT new_price INTO product_price
    FROM products
    WHERE id = product_id_param;
  
    IF orderId IS NULL THEN
        -- Nếu không có order_id tồn tại, thêm một đơn hàng mới
        INSERT INTO `book_store`.`orders` (`number`, `placed_on`, `user_id`, `address`,`email`,`method`,
			`name`, `note`, `status`)
		VALUES (null, null, user_id_param, null, email_param, null, null, null, "Carts");
        
        -- Lấy ra id của đơn hàng mới thêm vào
        SELECT id INTO orderId_2
        FROM orders
        WHERE orders.user_id = user_id_param AND status = 'Carts';
        
        -- Thêm sản phẩm vào giỏ hàng
        INSERT INTO carts(order_id, price, product_id, quantity) VALUES (orderId_2, product_price, product_id_param, quantity_new);
        
        -- Cập nhật số lượng sách trong kho
        UPDATE products SET quantity = quantity - quantity_new WHERE id = product_id_param;
    ELSE
		IF exists(SELECT * FROM carts WHERE order_id = orderId and product_id = product_id_param) THEN
			-- Cập nhật số lượng sách trong giỏ hàng
			UPDATE carts SET quantity = quantity + quantity_new WHERE product_id = product_id_param AND order_id = orderId;
            -- Cập nhật số lượng sách trong kho
			UPDATE products SET quantity = quantity - quantity_new WHERE id = product_id_param;
		ELSE
			-- Thêm sản phẩm vào giỏ hàng
			INSERT INTO carts(order_id, price, product_id, quantity) VALUES (orderId, product_price, product_id_param, quantity_new);
			
			-- Cập nhật số lượng sách trong kho
			UPDATE products SET quantity = quantity - quantity_new WHERE id = product_id_param;
		END IF;
    END IF;
END ;;
