    IF method_param IS NOT NULL THEN
		UPDATE orders
        SET method = method_param
        WHERE id = orderId;
    END IF;
    
    IF status_param IS NOT NULL THEN
		UPDATE orders
        SET status = status_param
        WHERE id = orderId;
