CREATE DEFINER=`root`@`localhost` PROCEDURE `UPDATE_SACH`(IN `user_id_param` INT, IN `product_id_param` INT, IN `quantity_new` INT)
BEGIN
    DECLARE orderId INT;
    DECLARE old_quantity INT;
    
    -- Lấy ra order_id kiểm tra có tồn tại chưa
    SELECT id INTO orderId
    FROM orders
    WHERE orders.user_id = user_id_param AND status = 'Carts';
    
    -- Lấy ra số lượng cũ
    SELECT quantity INTO old_quantity
    FROM carts
    WHERE product_id = product_id_param AND order_id = orderId;
    
    -- Kiểm tra xem orderId có tồn tại không
    IF orderId IS NOT NULL THEN
		UPDATE products SET quantity = quantity - quantity_new + old_quantity WHERE id = product_id_param;
