CREATE DEFINER=`root`@`localhost` PROCEDURE `XOA_SACH`(IN `user_id_param` INT, IN `product_id_param` INT)
BEGIN
    DECLARE orderId INT;
    DECLARE quantity_new INT; -- Thêm khai báo cho biến quantity_new
    
    -- Lấy ra order_id kiểm tra có tồn tại chưa
    SELECT id INTO orderId
    FROM orders
    WHERE user_id = user_id_param AND status = 'Carts';
    
    -- Lấy giá trị quantity từ bảng carts
    SELECT quantity INTO quantity_new 
    FROM carts 
    WHERE product_id = product_id_param AND order_id = orderId; -- Sử dụng orderId thay vì order_id_param
    
    -- Xóa sách khỏi giỏ hàng
    DELETE FROM carts WHERE product_id = product_id_param AND order_id = orderId;
  
    -- Cập nhật lại số lượng sách trong bảng products
    UPDATE products SET quantity = quantity + quantity_new WHERE id = product_id_param;
END ;;
